import './App.css';
import Build from './Build/Build.js';
import ContainerItem from './ContainerItem/ContainerItem.js';

function App() {
  return (
    <div className="App">

      <div className="ContainerItem_List">
          <ContainerItem group="OnTheWay"/>
          <ContainerItem group="Blast"/>
          <ContainerItem group="Orbit"/>
          <ContainerItem group="Screen"/>
          <ContainerItem group="Special"/>
        </div>

        <Build />

    </div>
  );
}


export default App;
